        self.label_2.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\"><span style=\" color:#22223b;\">Это</span> самая первая страница, которую ты можешь видеть</p><p><img src=\":/screenshots/screenshot_main_page_910x630.png\"/></p><p>Слева находится основное <span style=\" font-weight:600; color:#b5838d;\">меню приложения</span>, для перехода между разделами. Оно также присутствует в каждом окне приложения для навигации.</p><p>Двигаемся дальше - посередине страницы расположен <span style=\" font-weight:600; color:#b5838d;\">график</span>, который показывает, какое количество денежных средств хранится на всех твоих счетах за указанный месяц. Если у тебя нет графика - ничего страшного, просто запиши новые данные за любой месяц по твоему счёту, нажав на кнопку <span style=\" font-weight:600; color:#b5838d;\">Записать месяц </span><span style=\" color:#22223b;\">правом верхнем углу. </span></p><p><span style=\" color:#22223b;\">Остались только два элемента: сумма на счетах и текущий доход. </span></p><p><span style=\" font-weight:600; color:#b5838d;\">Сумма на счетах</span><span style=\" color:#22223b;\"> - это сумма всех денежных средств на всех твоих счетах на последний месяц, который ты записал.</span></p><p><span style=\" font-weight:600; color:#b5838d;\">Текущий доход</span><span style=\" color:#22223b;\"> - это доход, который ты указал при регистрации в анкете (или не указал). В любом случае, ты можешь изменить его, когда захочешь, в разделе </span><span style=\" font-weight:600; color:#b5838d;\">Мой профиль</span><span style=\" color:#22223b;\">.</span></p></body></html>"))
        self.back_button.setText(_translate("HelpPage", "Назад"))
        self.label_3.setText(_translate("HelpPage", "Запись месяца"))
        self.label_4.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\">Это раздел, который позволяет тебе заполнить данные за выбранный период</p><p align=\"center\"><img src=\":/screenshots/new_month_screenshot_970x1049.png\"/></p><p>Во-первых, тебе нужно <span style=\" font-weight:600; color:#b5838d;\">выбрать период</span>, за который ты вносишь данные по всем своим счетам.</p><p>Во-вторых, необходимо заполнить строку по <span style=\" font-weight:600; color:#b5838d;\">каждому</span> твоему счёту. Если на каком-либо твоём счёте на момент записи данных нет денежных средств, то следует заполнить строку, как в примере - 0,00. </p><p>Далее нажать кнопку Сохранить.</p><p>По одному месяцу ты можешь перезаписывать информацию сколько угодно раз, но в <span style=\" font-weight:600; color:#b5838d;\">итоговой статистике</span> будет учтена только та, что ты записал в <span style=\" font-weight:600; color:#b5838d;\">последний раз</span>. </p></body></html>"))
