        self.label_8.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\">Это страница, на которой содержатся основные твои данные как пользователя приложения</p><p><img src=\":/screenshots/screenshot_my_profile_page_970x630.png\"/><br/><span style=\" font-weight:600; color:#b5838d;\">Логин и пароль</span> - данные, которые указываются при регистрации в основном меню.</p><p><span style=\" font-weight:600; color:#b5838d;\">Имя, фамилия, доход</span> - данные, которые ты можешь заполнить при регистрации в анкете, либо же указать тут. </p><p>Обрати внимание на то, что при редактировании любых данных в этом разделе тебе необходимо <span style=\" font-weight:600; color:#b5838d;\">подтвердить изменения</span> вводом пароля в специальном окне:</p><p align=\"center\"><img src=\":/screenshots/screenshot_confirm_pass.png\"/></p><p>Подтверждение пароля также нужно при нажатии на значок глаза рядом с паролем - отображение пароля без маски. </p><p><span style=\" font-size:10pt;\">*при изменении пароля со старого на новый, в этом окне необходимо указать старый пароль, чтобы всё прошло успешно. </span><br/></p></body></html>"))
