        self.label_10.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\">Это страница, где ты можешь просмотреть, переименовать и добавить счета </p><p align=\"center\"><img src=\":/screenshots/screenshot_my_accounts_970x630.png\"/></p><p>Чтобы <span style=\" font-weight:600; color:#b5838d;\">удалить счёт</span>, ты можешь нажать на значок корзины рядом с ним. </p><p>При нажатии на кнопку <span style=\" font-weight:600; color:#b5838d;\">редактирования </span><span style=\" color:#22223b;\">откроется новое окно, в котором ты можем поменять наименования твоих счетов. </span></p><p><span style=\" color:#22223b;\">Также и при нажатии кнопки для </span><span style=\" font-weight:600; color:#b5838d;\">добавления счёта</span><span style=\" color:#22223b;\"> - открывается новое окно.</span></p><p><span style=\" font-size:10pt; color:#22223b;\">*обрати внимание, что у тебя не может быть двух одинаковых счетов с одним и тем же типом и наименованием.</span><br/></p></body></html>"))
