        self.back_button_6.setText(_translate("HelpPage", "Назад"))
        self.label_13.setText(_translate("HelpPage", "Добавление нового счёта "))
        self.label_14.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\">Такое окошо позволяет тебе добавить новые счета, но количество ограничено - </p><p align=\"center\">всего ты можешь иметь <span style=\" font-weight:600; color:#b5838d;\">10 счетов</span><br/><img src=\":/screenshots/screenshot_new_accounts.png\"/></p><p>Чтобы <span style=\" font-weight:600; color:#b5838d;\">добавить новые счета</span>, сначала укажи, какое количество тебе нужно - это нужно вписать в правом верхнем углу. Затем нажми на кнопку <span style=\" font-weight:600; color:#b5838d;\">добавления</span>, чтобы появились формы для заполнения данных. </p><p>А дальше всё просто - выбери тип для счёта и напиши его наименование. И, в конце концов, не забудь <span style=\" font-weight:600; color:#b5838d;\">сохранить</span> новые счета. </p><p>*<span style=\" font-size:10pt;\">также напоминаю, что у тебя не может быть двух одинаковых счетов с одним и тем же типом и наименованием</span></p></body></html>"))
        self.back_button_7.setText(_translate("HelpPage", "Назад"))
        self.label_15.setText(_translate("HelpPage", "История счетов"))
        self.help_sign_5.setText(_translate("HelpPage", "<html><head/><body><p><img src=\":/icons/help_icon_30x30.png\"/></p></body></html>"))
        self.label_16.setText(_translate("HelpPage", "<html><head/><body><p align=\"center\">Это страница, которая, пожалуй, содержит больше всего информации в приложении</p><p align=\"center\"><img src=\":/screenshots/accounts_history_screenshot_910x657.png\"/></p><p>Если ты вносишь каждый месяц данные по своим счетам, то при первом открытии страницы ты увидишь данные за <span style=\" font-weight:600; color:#b5838d;\">последние 3 месяца</span>. </p><p>Чтобы <span style=\" font-weight:600; color:#b5838d;\">изменить период</span>, ты можешь установить свой фильтр наверху страницы и нажать кнопку <span style=\" font-weight:600; color:#b5838d;\">установить</span>.</p><p>Теперь рассмотрим поподробнее:</p><p>- каждая таблица представляет собой <span style=\" font-weight:600; color:#b5838d;\">определённый период</span>, к примеру, Июль 2021 года (как на скриншоте)</p><p>- за выбранный период ты можешь видеть суммы на твоих счетах на <span style=\" font-weight:600; color:#b5838d;\">начало</span> этого периода и на <span style=\" font-weight:600; color:#b5838d;\">конец</span><br/>(к примеру, данные за Май 2021 будут началом периода Июль 2021 года, если окажется, что за предыдущий период нет данных, везде будут нули)</p><p>- в нижней части таблицы основная магия - <span style=\" font-weight:600; color:#b5838d;\">расчёт прибыли/убытка</span> по твоим счетам</p><p><span style=\" font-weight:600; color:#b5838d;\">Сумма расходов/доходов</span> - общая для всех твоих счетов, показывает разницу между всеми твоими денежными средствами за предыдущий и указанный период.</p><p>Сумма расходов/доходов разбивается на несколько <span style=\" font-weight:600; color:#b5838d;\">параграфов</span>:</p><p><span style=\" font-weight:600; color:#b5838d;\">по текущим счетам</span>: здесь считается разница между суммами на карточных и текущих счетах предыдущего и указанного периодов</p><p><span style=\" font-weight:600; color:#b5838d;\">по резервным счетам</span>: здесь считается разница между суммами на резервных счетах предыдущего и указанного периодов</p><p><span style=\" font-weight:600; color:#b5838d;\">по накопительным счетам</span>: здесь считается разница между суммами на накопительных счетах и вкладах предыдущего и указанного периодов<br/></p></body></html>"))
